import React from 'react';
import { View, Text, StyleSheet } from 'react-native-web';

export default function Main () {
    return (
        <View>
            <Text style={styles.Text}>Otro componente</Text>
        </View>
    );
};

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#000',
      alignItems: 'center',
      justifyContent: 'center',
    },
    Text: {
      color: '#fff'
    }
  });
